import React from 'react';
import './Product.css'
const Product = (props) => {
    const {img,category,name,seller,price,stock}= props.product;
    return (
        <div className='product'>
            <div>
                <img src={img} alt=""  />
            </div>
            <div>
                <h3>{category}: {name}</h3>
                <p><small>by {seller}</small></p>
                <p>${price}</p>
                <p><small>Only {stock} left in stock.</small></p>
            </div>
            
        </div>
    );
}; 

export default Product;
